import React from "react";

const SharePointMigration = () => {
  return (
    <div className="portfolio-detail">
      <h1>SharePoint Data Migration</h1>
      <p>
        Successfully migrated corporate data to a new SharePoint platform with
        integration of OneDrive and Microsoft Teams, enhancing collaboration and productivity.
      </p>
      <img src="/assets/sharepoint-migration.png" alt="SharePoint Data Migration" />
    </div>
  );
};

export default SharePointMigration;
